INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (6,'All travel bookings (airline, hotel, car rental etc) must be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here]. Fees associated with booking travel through these channels may be expensed. The use of any provider, including booking direct with the provider (airline, hotel, car rental etc.) is strictly prohibited, and will not be reimbursed for expenses.','All travel bookings (airline, hotel, car rental etc) must be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here]. Fees associated with booking travel through these channels may be expensed. The use of any provider, including booking direct with the provider (airline, hotel, car rental etc.) is strictly prohibited and may not be reimbursed for expenses.','All travel bookings (airline, hotel, car rental etc) should be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here]. Fees associated with booking travel through these channels may be expensed. The use of any provider, including booking direct with the provider (airline, hotel, car rental etc.) is prohibited and may not be reimbursed for expenses.','Travel bookings (airline, hotel, car rental etc) can be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here]. Fees associated with booking travel through these channels may be expensed. When booking travel outside of these channels, the TMC and/or leadership must be made aware for employee safety and security.','When booking travel (airline, hotel, car rental etc), employee leaders should be made aware of your travel itinerary for employee safety and security. Tr